import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import styles from './DailyCaloriesForm.module.css';

const DailyCaloriesForm = ({ initialValues }) => {
  const [formData, setFormData] = useState({
    height: '',
    age: '',
    currentWeight: '',
    desiredWeight: '',
    bloodType: '1',
  });

  const [calories, setCalories] = useState(null);
  const [allForbiddenFoods, setAllForbiddenFoods] = useState([]);
  const [forbiddenFoods, setForbiddenFoods] = useState([]);
  const [modalOpen, setModalOpen] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    if (initialValues) {
      setFormData(initialValues);
    }
  }, [initialValues]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({ ...prevData, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:5000/dailycalorieintake', formData);
      setCalories(response.data.calories);
      setForbiddenFoods(response.data.forbiddenFoods);
      
      const allForbiddenFoods = response.data.allForbiddenFoods || [];
      const currentDate = new Date().toLocaleDateString('ro-RO').replace(/\//g, '.');

      localStorage.setItem('calorieFormData', JSON.stringify(formData));
      localStorage.setItem('caloriesData', JSON.stringify({
        dailyRate: response.data.calories,
        consumed: 0,
        forbiddenFoods: response.data.forbiddenFoods,
        allForbiddenFoods: allForbiddenFoods,
        dateCompleted: currentDate,
      }));

      setModalOpen(true);
    } catch (error) {
      console.error('Error calculating calories:', error);
    }
  };

  const closeModal = () => {
    setModalOpen(false);
  };

  useEffect(() => {
    document.body.classList.toggle('modal-open-main', modalOpen);
  }, [modalOpen]);

  const redirectToLogin = () => {
    navigate('/login');
  };

  return (
    <form onSubmit={handleSubmit} className={styles.form}>
      <div className="column">
        <label>
          Height (cm)*
          <input
            type="number"
            name="height"
            required
            onChange={handleChange}
            value={formData.height}
          />
        </label>

        <label>
          Age (years)*
          <input
            type="number"
            name="age"
            required
            onChange={handleChange}
            value={formData.age}
          />
        </label>

        <label>
          Current weight (kg)*
          <input
            type="number"
            name="currentWeight"
            required
            onChange={handleChange}
            value={formData.currentWeight}
          />
        </label>
      </div>

      <div className="column">
        <label>
          Desired weight (kg)*
          <input
            type="number"
            name="desiredWeight"
            required
            onChange={handleChange}
            value={formData.desiredWeight}
          />
        </label>

        <label>Blood type*</label>
        <div className={styles.bloodTypeOptions}>
          {['1', '2', '3', '4'].map((type) => (
            <label
              key={type}
              className={`${styles.bloodTypeLabel} ${
                formData.bloodType === type ? 'active' : ''
              }`}
            >
              <input
                type="radio"
                name="bloodType"
                value={type}
                checked={formData.bloodType === type}
                onChange={handleChange}
              />
              <span className={styles.radioCircle}></span>
              <span className={styles.bloodTypeNumber}>{type}</span>
            </label>
          ))}
        </div>
      </div>

      <button className={styles.submitBtn} type="submit">
        Start losing weight
      </button>
    </form>
  );
};

export default DailyCaloriesForm;
